import { NavLink } from "react-router-dom";

const NavLi = (props) => {
  console.log(props.active);
  return (
    <li className="nav-item nav-li">
      <NavLink
        className={({ isActive }) => "nav-link " + (isActive ? props.active : "")}
        to={`/${props.children}`}>
        {props.children}
      </NavLink>
    </li>
  );
}

export default NavLi;
